                nodes={nodes}
                edges={edges}
                onNodesChange={onNodesChange}
                onEdgesChange={onEdgesChange}
                onConnect={onConnect}
                connectionLineType={ConnectionLineType.SmoothStep}
                // fitView
                onNodeClick={(event, element) => {
                    const {data} = element;
                    setChildrenModal(DetailIntent(data))
